svg.script:

let noteColorClass = "euroNote_neutral", stripeColorClass = "euroNoteStripe_neutral";
if(this.frameElement) {
    let id = this.frameElement.id || this.frameElement.getAttribute("data-item-value");
    if(id && !isNaN(id)) {
        document.getElementById("noteValueLeft").textContent = "" + (parseInt(id) / 100);
        document.getElementById("noteValueRight").textContent = "" + (parseInt(id) / 100);
        switch(id) {
            case "500":
                noteColorClass = "euroNote_5";
                stripeColorClass = "euroNoteStripe_5";
                break;
            case "1000":
                noteColorClass = "euroNote_10";
                stripeColorClass = "euroNoteStripe_10";
                break;
            case "2000":
                noteColorClass = "euroNote_20";
                stripeColorClass = "euroNoteStripe_20";
                break;
            case "5000":
                noteColorClass = "euroNote_50";
                stripeColorClass = "euroNoteStripe_50";
                break;
            case "10000":
                noteColorClass = "euroNote_100";
                stripeColorClass = "euroNoteStripe_100";
                break;
            case "20000":
                noteColorClass = "euroNote_200";
                stripeColorClass = "euroNoteStripe_200";
                break;
            case "50000":
                noteColorClass = "euroNote_500";
                stripeColorClass = "euroNoteStripe_500";
                break;
        }
    }
}
document.getElementById("noteColorAll").setAttribute("class", noteColorClass);
document.getElementById("noteColorMiddle").setAttribute("class", noteColorClass);
document.getElementById("stripe").setAttribute("class", stripeColorClass);
